package practice;


public class ContinueLearning {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
for (int i = 0; i < 10; i++) {
	if (i==5) continue;
	System.out.println("To Print the values of " +i);
		}
	for (int j = 0; j < 21; j++) {
		if(j%2==1){
			System.out.println("To Print the Odd Number" +j);
		}else {
			System.out.println("To Print the even Number" +j);
		}
	}
	}
}
	
